import React, { useEffect, useState, useCallback } from "react";
import { useDispatch } from "react-redux";
import { toggleMenu } from "./utils/appSlice";
import { Link } from "react-router-dom";

const Header = () => {
  const dispatch = useDispatch();
  const [searchData, setSearchData] = useState([]);

  const toggleMenuHandler = () => {
    dispatch(toggleMenu());
  };

  const handleSearch = useCallback(() => {
    if (searchData.length !== 0) {
      searchData.forEach((data) => {
        console.log(data);
      });
    }
  }, [searchData]);

  useEffect(() => {
    fetchData();
  }, [handleSearch]);

  const fetchData = async () => {
    const api = await fetch("http://suggestqueries.google.com/complete/search?client=firefox&ds=yt&q=samsung");
    const result = await api.json();
    console.log(result[1]);
    setSearchData(result[1]);
  };

  return (
    <div className="grid grid-flow-col justify-between r m-2 p-2">
      <div className="flex col-span-1 items-center">
        <img
          onClick={toggleMenuHandler}
          className="cursor-pointer w-12 h-12"
          src="data:image/png;base64,"
          alt="menu"
        />
        <img
          className="w-24 h-22"
          src="data:image/png;base64,"
          alt="logo"
        />
      </div>
      <div className="col-span-10">
        <div>
          <input
            type="text"
            className="px-5 w-1/2 border border-gray-400 p-2 rounded-l-full"
          />
          <button className="px-5 border border-gray-400 py-2 bg-gray-100 rounded-r-full">
            🔍
          </button>
        </div>
      </div>
      <div className="col-span-1">
        <img
          className="w-10 h-10"
          alt="user"
          src="data:image/png;base64,"
        />
      </div>
    </div>
  );
};

export default Header;
